import styled from 'styled-components';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom';
import {Button} from 'reactstrap';


export default function Landing (props) {


    return (
        // Render the Pizza component 
        <div> 
            <StyledBanner>
                <div className='banner-wrapper'> 
                    <img className='banner-image' src= 'https://relaxedpowerful.s3.us-east-2.amazonaws.com/landing-banner.jpg' alt='banner'/> 
                </div>
                <div className='headline-wrapper'>
                    <h1>
                        <span>
                            Co-Make
                        </span>
                    </h1>
                    <h3> 
                        <span>
                            The best place for community cooperation
                        </span>
                    </h3>
                </div>
                <div className='buttons-wrapper'> 
                    <Button color='primary' className='join custom' btn-block>
                        Sign up 
                    </Button> {'  '}
                    <Button color='primary' className='login custom' btn-block>
                        Existing Member? Login
                    </Button> {'  '}
                    <Button color='success' className='login custom' btn-block>
                        What members are saying
                    </Button>
                </div>
            </StyledBanner>            
        </div>

    )
};

const StyledBanner =styled.div `
border: green 2px dashed;

position: relative;
margin-top: 20px;    
display: flex;
flex-flow: column wrap;
justify-content: center;
align-items: center;

    .banner-wrapper{
        /* border: 1px red solid; */
        display: flex;
        flex-flow: column wrap;
        justify-content: center;
        align-items: center;
        /* max-width: 90%; */
        /* max-height: 20%; */
    }
    .banner-image {
        width: 100%;
        height: auto;
    }
    .headline-wrapper {
        /* border: white  2px solid; */
        display: flex;
        flex-flow: column;
        position: absolute; 
        top: 10%; 
        align-items: baseline;
        width: 100%; 
    }
    .buttons-wrapper {
        border: red dashed 9px;
        position: absolute;
        display: flex;
        min-width: 40%;
        /* justify-content: center; */
    }


    span { 
   color: white; 
   font: bold Helvetica, Sans-Serif; 
   letter-spacing: -1px;  
   background: rgb(0, 0, 0); /* fallback color */
   background: rgba(0, 0, 0, 0.7);
   padding: 10px; 
   }

   .custom {
    width: 200px !important;
    height: 60px !important;
    }

`
